/**
 *
 * @export
 * @interface PastValue
 */
export interface PastValue {
    [key: string]: any;
    /**
     * Date used to specify timeframe for a reporting call (in YYYY-MM-DD format). These dates are inclusive.
     * @type {string}
     * @memberof PastValue
     */
    'date'?: string;
    /**
     *
     * @type {number}
     * @memberof PastValue
     */
    'value'?: number;
    /**
     *
     * @type {string}
     * @memberof PastValue
     */
    'currency'?: string;
}
